import React from "react";
import { tsPropertySignature } from "@babel/types";

function Card(props) {
    return (
        <div>
            <img src={props.url}></img>
            <h3>Name: {props.name}</h3>
            <p>Phone: {props.phoneNum}</p>
            <p>Email: {props.email}</p>
        </div>
    );
}

export default Card;
